import React from 'react';

function Footer(){
    return(
        <footer className="container__footer">
            
            
            <a><img src="img/iconmonstr-github-3.svg" alt="github link"></img></a>
            <a><img src="img/iconmonstr-linkedin-1.svg" alt="linkedin link"></img></a>
            <a><img src="img/iconmonstr-instagram-11.svg" alt="instagram link"></img></a>
            
        </footer>
    )
}

export default Footer;
